// src/pages/ResetPasswordPage.js
import React, { useState, useEffect } from 'react';
import { Link, useSearchParams, useNavigate } from 'react-router-dom';
import { authFetch } from '../services/api';
import { useToast } from '../hooks/useToast';
import AuthCard from '../components/auth/AuthCard';

// Definisikan komponen Spinner di sini atau import dari file terpisah
const Spinner = () => <div className="spinner"></div>;

function ResetPasswordPage() {
  const [password, setPassword] = useState('');
  const [passwordConfirm, setPasswordConfirm] = useState('');

  // State untuk toggle password
  const [showPassword, setShowPassword] = useState(false);
  const [showPasswordConfirm, setShowPasswordConfirm] = useState(false);

  // State untuk validasi real-time
  const [passwordError, setPasswordError] = useState('');
  const [passwordConfirmError, setPasswordConfirmError] = useState('');

  const [isLoading, setIsLoading] = useState(false);

  const [searchParams] = useSearchParams();
  const token = searchParams.get('token');

  const { showToast } = useToast();
  const navigate = useNavigate();

  useEffect(() => {
    if (!token) {
      showToast('Token reset tidak valid', 'error');
      navigate('/login');
    }
  }, [token, showToast, navigate]);

  // Handler validasi untuk password baru
  const handlePasswordChange = (e) => {
    const newPassword = e.target.value;
    setPassword(newPassword);

    if (newPassword.length > 0 && newPassword.length < 6) {
      setPasswordError('Password minimal 6 karakter');
    } else {
      setPasswordError('');
    }

    // Cek ulang konfirmasi jika password utama diubah
    if (passwordConfirm.length > 0 && newPassword !== passwordConfirm) {
      setPasswordConfirmError('Password dan konfirmasi tidak sama');
    } else {
      setPasswordConfirmError('');
    }
  };

  // Handler validasi untuk konfirmasi password
  const handlePasswordConfirmChange = (e) => {
    const newConfirm = e.target.value;
    setPasswordConfirm(newConfirm);

    if (newConfirm.length > 0 && newConfirm !== password) {
      setPasswordConfirmError('Password dan konfirmasi tidak sama');
    } else {
      setPasswordConfirmError('');
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validasi ulang saat submit
    if (password.length < 6) {
      setPasswordError('Password minimal 6 karakter');
      showToast('Password minimal 6 karakter', 'error');
      return;
    }
    if (password !== passwordConfirm) {
      setPasswordConfirmError('Password dan konfirmasi tidak sama');
      showToast('Password dan konfirmasi tidak sama', 'error');
      return;
    }

    // Bersihkan error jika lolos validasi
    setPasswordError('');
    setPasswordConfirmError('');

    setIsLoading(true);
    try {
      const data = await authFetch(`/auth/reset/${token}`, {
        method: 'POST',
        body: JSON.stringify({ password })
      });
      showToast(data.message, 'success');
      setTimeout(() => navigate('/login'), 2000);
    } catch (error) {
      showToast(error.message, 'error');
      setIsLoading(false);
    }
  };

  return (
    <AuthCard subtitle="Reset Password Baru">
      <form id="resetForm" onSubmit={handleSubmit}>

        {/* Form Group Password Baru */}
        <div className="form-group">
          <input 
            type={showPassword ? 'text' : 'password'}
            id="password" 
            className="form-input input-password"
            placeholder=" "
            value={password}
            onChange={handlePasswordChange} 
            required 
          />
          <label htmlFor="password" className="form-label">Password Baru</label>
          <button 
            type="button" 
            className="password-toggle-btn"
            onClick={() => setShowPassword(!showPassword)}
          >
            {showPassword ? 'Hide' : 'Show'}
          </button>
          {passwordError && <small className="form-error">{passwordError}</small>}
        </div>

        {/* Form Group Konfirmasi Password */}
        <div className="form-group">
          <input 
            type={showPasswordConfirm ? 'text' : 'password'} 
            id="passwordConfirm" 
            className="form-input input-password"
            placeholder=" "
            value={passwordConfirm}
            onChange={handlePasswordConfirmChange}
            required 
          />
          <label htmlFor="passwordConfirm" className="form-label">Konfirmasi Password Baru</label>
          <button 
            type="button" 
            className="password-toggle-btn"
            onClick={() => setShowPasswordConfirm(!showPasswordConfirm)}
          >
            {showPasswordConfirm ? 'Hide' : 'Show'}
          </button>
          {passwordConfirmError && <small className="form-error">{passwordConfirmError}</small>}
        </div>

        {/* Tombol Submit dengan Spinner */}
        <button type="submit" className="btn" disabled={isLoading}>
          {isLoading ? <Spinner /> : 'Reset Password'}
        </button>
      </form>

      <div className="auth-links text-center">
        <Link to="/login" className="auth-link">Kembali ke Login</Link>
      </div>
    </AuthCard>
  );
}

export default ResetPasswordPage;
